        this.setState(
            {
            [e.target.name]: e.target.value
            }
        )
        console.log(this.state);
    }
    Password = () => {
    const pw = document.getElementById("myPW");
    if (pw.type === "password") {
        pw.type = "text";
        } else {
        pw.type = "password";
        }
    }

    render(){
        return(
            <div>
                <form>
                    Email: <input type='text' name='email'></input> <br/>
                    Password: <input type='password' name='password' onChange={this.handleChange} value={this.state.PassWord} id='myPW'></input>
                </form> <br/>
                <button>Login</button>
                <button>Submit</button>
            </div>
        )
    }
}


export default Login
